Comparing HIV-uninfected women from 2011 and 2012, a lower percentage of illness samples obtained during RSV season were available for RSV testing from the 2012 cohort (87.5% [1460/1669] vs 94.9% [798/841]; 
 P < .001). Nevertheless, a greater percentage of women had RSV-associated illness from the 2012 cohort compared with the 2011 cohort overall (3.1% vs 0.9%; 
 P < .001), as well as during the RSV season (2.8% vs 0.9%; 
 P = .001) (
 Table 2). Of the 33 RSV illnesses identified from the 2012 cohort, there were 25 cases of RSV-A and 9 cases of RSV-B, with 1 episode having both subtypes identified simultaneously.
